  \"2015-09-26T19:35:30.584570\",\n\t\"name\": \"environmental-sensitivity-index-esi-atlas-mississippi-maps-and-geographic-information-systems-d\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises the Environmental
  Sensitivity Index (ESI) maps for the shoreline of Mississippi. ESI data characterize
  coastal environments and wildlife by their sensitivity to spilled oil. The ESI data
  include information for three main components: shoreline habitats; sensitive biological
  resources; and human-use resources. This atlas was developed to be utilized within
  desktop GIS systems and contains GIS files and related D-base files. Associated
  files include MOSS (Multiple Overlay Statistical System) export files, .PDF maps,
  and detailed user guides and metadata.nnThe intertidal habitats were mapped during
  aerial and ground surveys conducted in 1995. The biological and human-use resources
  data were compiled by regionalnbiologists in 1995. The dates for these data vary
  and range from 1968 to 1995. Dates are documented in the included metadata file.\",\n\t\"license_title\":
